void OAIVerifyV2BucketApi::updateBucket(const QString &service_sid, const QString &rate_limit_sid, const QString &sid, const ::OpenAPI::OptionalParam<qint32> &interval, const ::OpenAPI::OptionalParam<qint32> &max) {
    QString fullPath = QString(_serverConfigs["updateBucket"][_serverIndices.value("updateBucket")].URL()+"/v2/Services/{ServiceSid}/RateLimits/{RateLimitSid}/Buckets/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString service_sidPathParam("{");
        service_sidPathParam.append("ServiceSid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "ServiceSid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"ServiceSid"+pathSuffix : pathPrefix;
        fullPath.replace(service_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(service_sid)));
    }
    
    {
        QString rate_limit_sidPathParam("{");
        rate_limit_sidPathParam.append("RateLimitSid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "RateLimitSid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"RateLimitSid"+pathSuffix : pathPrefix;
        fullPath.replace(rate_limit_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(rate_limit_sid)));
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (interval.hasValue())
    {
        input.add_var("Interval", ::OpenAPI::toStringValue(interval.value()));
    }
    if (max.hasValue())
    {
        input.add_var("Max", ::OpenAPI::toStringValue(max.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIVerifyV2BucketApi::updateBucketCallback);
    connect(this, &OAIVerifyV2BucketApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

